import React from "react";
import idIcon from "./assets/i-id.png";
import comercioIcon from "./assets/i-comercio.png";
import depIcon from "./assets/i-dep.png";
import eduIcon from "./assets/i-edu.png";

function AGEBInfo({ ageb, neighborhood }) {
  if (!ageb || !neighborhood) {
    return <div>No neighborhood or AGEB information available.</div>;
  }

  return (
    <div className="ageb-container">
      <div className="ageb-info">
        <h4 className="name">{neighborhood.display_name}</h4>

        <p>
          <img className="icon" src={idIcon} alt="ID Icon" />
          {ageb.properties.CVEGEO}
        </p>

        <p>
          <img className="icon" src={comercioIcon} alt="Comercio Icon" />
          {ageb.properties.comercios_count}
        </p>

        <p>
          <img className="icon" src={depIcon} alt="Deportivos Icon" />{" "}
          {ageb.properties.deportivos_count}
        </p>
        <p>#Centros Educativos: {ageb.properties.educacion_count}</p>
        <p>#Guarderías Públicas: {ageb.properties.guarderias}</p>
        <p>#Deportivos: {ageb.properties.deportivos_count}</p>
        <p>#Deportivos: {ageb.properties.deportivos_count}</p>
        <p>#Deportivos: {ageb.properties.deportivos_count}</p>
      </div>

      <div className="model-info name">
        <h4>Prediction model goes here...</h4>
      </div>
    </div>
  );
}

export default AGEBInfo;
